import React from "react";
import github from "./../../assets/github-logo.svg";
import linkedin from "./../../assets/linkedin-logo.svg";

const Header = () => {
  return (
    <div className="backdrop-blur-sm  w-full">
      <div className="w-full flex h-24 justify-between items-center text-base max-w-[1500px] m-auto">
        <div>Hugo Granier</div>
        <div className="flex text-white gap-20">
          <button className="">Accueil</button>
          <button>Comp√©tence</button>
          <button>Qualification</button>
          <button>Contact</button>
        </div>

        <div className="flex text-white gap-5">
          <img src={github} alt="github" />
          <img src={linkedin} alt="linkedin" />
        </div>
      </div>
    </div>
  );
};
export default Header;
